def scramble(block, seed):
    raw = "".join(s for s in block)
    # print("raw: ", raw)
    bm = "10 " * len(raw)
    bm = bm.split(" ")
    for i in range(len(raw)):
        y = (i * seed) % len(raw)
        n = bm[y]
        while (n != "10"):
            y = (y + 1) % len(raw)
            n = bm[y]
        if raw[i] == "1":
            n = "11"
        else:
            n = "00"
        bm[y] = n
    raw2 = "".join(s for s in bm)
    # print("raw2: ", raw2)
    b = int(raw2, 2)
    return b

